import React from 'react';
import './App.css';
import SimpleContainer from './Components/pruebaMaterial';
import Title from './Components/title';

function App() {
  return (
    <div className="App">
      <Title/>
      <h1>Hola </h1>
      <SimpleContainer/>
    </div>
  );
}

export default App;
